description:
Shutup &amp; Jam! is the 14th solo studio album by American guitarist and singer Ted Nugent. The album is scheduled to be released on 7 July 2014 in the UK and 8 July 2014 in North America. It features a guest appearance by Sammy Hagar on the song &quot;She's Gone&quot;, and is his first studio album since 2007's Love Grenade.

